// lib
import React from "react";
import { createUseStyles } from "react-jss";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

// components
import SignIn from "../users/signIn/SignIn";
import SignUp from "../users/signUp/SignUp";
import HeaderUser from "./HeaderUser";


// =================================================================
const useStyles = createUseStyles({
  Header: {
    padding: "2rem 10rem",
    fontSize: "1.6rem",
    backgroundColor: " #1d1d26",
  },
  header__logo: {
    textTransform: "uppercase",
    fontSize: "3rem",
    fontWeight: "700",
  },

  header__button: {
    "&:not(:lastchild)": {
      marginRight: "2rem",
    },
  },
});

export default function Header(props) {
  const classes = useStyles();

  return (
    <div
      className={
        classes.Header +
        ` position-fixed w-100 t-0 d-flex align-items-center justify-content-between `
      }
    >
      <a className={classes.header__logo} href="http://">
        todo
      </a>
      {props.user.email === "" ? (
        <div className="header__buttons btns--flex">
          <Link to="users/signIn">
            <button
              className={
                classes.header__button +
                ` button btn--none-border btn--hover-bb mb-0`
              }
            >
              Sign in
            </button>
          </Link>
          <Link to="user/signUp">
            <button
              className={
                classes.header__button +
                ` button btn--border btn--hover-border mb-0`
              }
            >
              Sign up
            </button>
          </Link>
        </div>
      ) : (
        <HeaderUser user={user}/>
      )}
    </div>
  );
}
